import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const OrderHistory = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchOrderHistory = async () => {
      try {
        const email = localStorage.getItem('email');
        if (!email) {
          setError('Please log in to view your order history.');
          setLoading(false);
          return;
        }

        const response = await axios.get(`http://localhost:5000/api/customers/orders/history/${email}`);
        setOrders(response.data);
        setLoading(false);
      } catch (err) {
        console.error('Error fetching order history:', err);
        setError('Failed to fetch order history: ' + (err.response?.data?.message || err.message));
        setLoading(false);
      }
    };

    fetchOrderHistory();
  }, []);

  if (loading) {
    return (
      <div className="d-flex justify-content-center mt-5">
        <div className="spinner-border text-primary" role="status">
          <span className="visually-hidden">Loading...</span>
        </div>
      </div>
    );
  }

  if (error) {
    return <div className="alert alert-danger mt-5">{error}</div>;
  }

  return (
    <div className="container mt-4">
      <h2>
        Your Order History{' '}
        {orders.length > 0 && <small className="text-muted">({orders.length} orders)</small>}
      </h2>
      {orders.length === 0 ? (
        <div className="text-center mt-5">
          <p className="lead">You haven't placed any orders yet.</p>
          <button className="btn btn-primary" onClick={() => navigate('/Home')}>
            Start Shopping
          </button>
        </div>
      ) : (
        orders.map((order) => (
          <div key={order._id} className="card mb-3">
            <div className="card-body">
              <h5 className="card-title">Order ID: {order._id}</h5>
              <p className="card-text">Total: ₹{order.total.toFixed(2)}</p>
              <p className="card-text">
                Date: {new Date(order.createdAt).toLocaleString('en-US', {
                  year: 'numeric',
                  month: 'long',
                  day: 'numeric',
                  hour: 'numeric',
                  minute: 'numeric',
                  hour12: true,
                })}
              </p>
              {order.address && (
                <div>
                  <h6>Delivery Address:</h6>
                  <p>
                    {order.address.label}: {order.address.addressLine1}, {order.address.houseNo},{' '}
                    {order.address.building}
                    {order.address.landmark ? `, ${order.address.landmark}` : ''}
                  </p>
                </div>
              )}
              <h6>Items:</h6>
              <ul className="list-group list-group-flush">
                {order.items.map((item, index) => (
                  <li key={index} className="list-group-item d-flex align-items-center">
                    {item.ProductImage && (
                      <img
                        src={`data:image/png;base64,${item.ProductImage}`}
                        alt={item.ProductName}
                        style={{ width: '50px', height: '50px', objectFit: 'cover', marginRight: '10px' }}
                      />
                    )}
                    <span className="flex-grow-1">{item.ProductName || 'Unnamed Product'}</span>
                    <span>₹{(item.ProductPrice?.toFixed(2) || '0.00')} x {item.ProductQuantity || 0}</span>
                  </li>
                ))}
              </ul>
            </div>
          </div>
        ))
      )}
    </div>
  );
};

export default OrderHistory;
